import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import {
  Container,
  Paper,
  Typography,
  Grid,
  Card,
  CardContent,
  Button,
  Box,
} from '@mui/material';
import axios from 'axios';

function StudentCard() {
  const { id } = useParams();
  const [student, setStudent] = useState(null);

  useEffect(() => {
    fetchStudent();
  }, [id]);

  const fetchStudent = async () => {
    try {
      const response = await axios.get(`http://localhost:5001/api/students/${id}`, {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
      });
      setStudent(response.data);
    } catch (error) {
      console.error('Errore nel caricamento dello studente:', error);
    }
  };

  const handleLessonClick = async (lessonIndex) => {
    try {
      await axios.patch(
        `http://localhost:5001/api/students/${id}/lessons/${lessonIndex}`,
        {},
        {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
        }
      );
      fetchStudent();
    } catch (error) {
      console.error('Errore nell\'aggiornamento della lezione:', error);
    }
  };

  if (!student) {
    return (
      <Container>
        <Typography>Caricamento...</Typography>
      </Container>
    );
  }

  return (
    <Container maxWidth="sm" sx={{ mt: 4, display: 'flex', justifyContent: 'center' }}>
      <Box
        sx={{
          width: 320,
          height: 500,
          borderRadius: 6,
          boxShadow: '0 8px 32px #0005',
          position: 'relative',
          overflow: 'hidden',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'flex-end',
          p: 0,
          m: 0,
          background: '#fff',
        }}
      >
        {/* Sfondo immagine */}
        <img
          src="/main.jpg"
          alt="Boxe BG"
          style={{
            position: 'absolute',
            top: 0,
            left: 0,
            width: '100%',
            height: '100%',
            objectFit: 'cover',
            zIndex: 0,
          }}
        />
        {/* Overlay trasparente per contrasto */}
        <Box sx={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          bgcolor: 'rgba(0,0,0,0.35)',
          zIndex: 1,
        }} />
        {/* Badge lezioni: due righe da 5 in basso sopra il nome */}
        <Box sx={{
          position: 'absolute',
          left: 0,
          bottom: 70,
          width: '100%',
          zIndex: 3,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          gap: 0.5,
        }}>
          {[0, 1].map(row => (
            <Box key={row} sx={{ display: 'flex', flexDirection: 'row', gap: 1, justifyContent: 'center' }}>
              {student.lessons.slice(row * 5, row * 5 + 5).map((lesson, index) => (
                <Box
                  key={row * 5 + index}
                  sx={{
                    width: 28,
                    height: 28,
                    borderRadius: '50%',
                    bgcolor: lesson.isUsed ? '#e0e0e0' : '#fff',
                    border: lesson.isUsed ? '2px solid #aaa' : '2px solid #1976d2',
                    boxShadow: lesson.isUsed ? 'none' : '0 2px 8px #1976d233',
                    opacity: 0.85,
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    cursor: lesson.isUsed ? 'default' : 'pointer',
                    fontWeight: 700,
                    fontSize: 13,
                    color: lesson.isUsed ? '#888' : '#1976d2',
                    mb: 0,
                    transition: 'all 0.2s',
                  }}
                  onClick={() => !lesson.isUsed && handleLessonClick(row * 5 + index)}
                >
                  {row * 5 + index + 1}
                </Box>
              ))}
            </Box>
          ))}
        </Box>
        {/* Nome studente in basso su barra bianca arrotondata, più piccolo */}
        <Box sx={{
          position: 'absolute',
          left: 0,
          bottom: 0,
          width: '100%',
          bgcolor: 'rgba(255,255,255,0.97)',
          py: 1,
          zIndex: 4,
          borderTopLeftRadius: 32,
          borderTopRightRadius: 32,
          boxShadow: '0 -2px 12px #0002',
        }}>
          <Typography
            variant="subtitle1"
            align="center"
            sx={{
              fontFamily: "'Oswald', Impact, Arial, sans-serif",
              fontWeight: 700,
              letterSpacing: 1,
              color: '#1976d2',
              textShadow: '1px 1px 2px #fff',
              m: 0,
              fontSize: 18,
            }}
          >
            {student.name}
          </Typography>
        </Box>
      </Box>
    </Container>
  );
}

export default StudentCard;
